                    </p>
                </div>
                
                <div className="contbox">
                    <div className="travelimg"></div>
                    <h1>세계대탐방그룹</h1>
                    <p>
                        열심히 일한 당신, 떠나라.
                        열심히 노는 당신, 당신도 떠나라.
                    </p>
                </div>
                
                <div className="contbox">
                    <div className="foodimg"></div>
                    <h1> 먹부림 그룹</h1>
                    <p>
                        미식가 여러분 환영합니다~!
                    </p>
                </div>

            </div>
        </div>
    );
};

export default IndexPage;
